@classmethod
def _parse_date_time(cls, value: DateParseType, tzinfo: Optional[TzInfo] = None) -> int:
    if isinstance(value, (datetime, dtdate)):
        return datetime_to_timestamp(value)
    # When tzinfo is None, use a static reference time to ensure
    # reproducible results when seeding Faker. When tzinfo is provided,
    # use the actual current time.
    now = datetime.now(tzinfo) if tzinfo is not None else datetime(1970, 1, 1)
    if isinstance(value, timedelta):
        return datetime_to_timestamp(now + value)
    if isinstance(value, str):
        if value == "now":
            return datetime_to_timestamp(datetime.now(tzinfo) if tzinfo is None else now)
        time_params = cls._parse_date_string(value)
        return datetime_to_timestamp(now + timedelta(**time_params))  # type: ignore
    if isinstance(value, int):
        return value
    raise ParseError(f"Invalid format for date {value!r}")

